// import logo from '../logo.svg';
// import './App.css';

import React from "react";
import Header from "./Header";
import Main from "./Main";
import Footer from "./Footer";
import PopupWithForm from "./PopupWithForm";

function App() {
  return (
    <div className="page">
      <Header />

      <Main />

      <Footer />

      <PopupWithForm name="profile" title="Редактировать профиль" />

      <PopupWithForm name="places" title="Новое место" buttonSave="Создать" />

      <PopupWithForm name="avatar" title="Обновить автар" />

      <PopupWithForm name="delete" title="Вы уверены?" buttonSave="Да" />

      <PopupWithForm name="photo" title="Редактировать профиль" />
    </div>
  );
}

export default App;
